import ReactDOM from 'react-dom';

ReactDOM.render(
<>
    <h1> My Favorite Series</h1>
    <h2> Netflix </h2>
    <ol>
    <li> Friends </li>
    <li> B-99 </li>
    <li> TBBT</li>
    <li> Mulaney </li>
    <li> Patriot Act </li>  
    </ol>
 </> , 
